(self.webpackChunkdemo=self.webpackChunkdemo||[]).push([[34352],{34352:n=>{n.exports='<header tuiNavigationHeader>\n    <div\n        tuiGroup\n        [collapsed]="true"\n        [style.margin]="\'auto\'"\n    >\n        <label\n            appearance=""\n            tuiBlock="s"\n        >\n            <input\n                tuiBlock="s"\n                type="radio"\n                value="basic"\n                [(ngModel)]="current"\n            />\n            Basic\n        </label>\n        <label\n            appearance=""\n            tuiBlock="s"\n        >\n            <input\n                tuiBlock="s"\n                type="radio"\n                value="input"\n                [(ngModel)]="current"\n            />\n            Input\n        </label>\n        <label\n            appearance=""\n            tuiBlock="s"\n        >\n            <input\n                tuiBlock="s"\n                type="radio"\n                value="card"\n                [(ngModel)]="current"\n            />\n            Card\n        </label>\n    </div>\n</header>\n<main tuiNavigationMain>\n    <header tuiSubheader>\n        @if (current === \'basic\') {\n            <ng-container>\n                <a\n                    iconStart="@tui.chevron-left"\n                    tuiLink\n                    [textContent]="\'Repositories\'"\n                ></a>\n                <h2 tuiHeader>\n                    <div tuiTitle>\n                        <div tuiNavigationLogo>\n                            <tui-icon icon="@tui.gitlab" />\n                            <span tuiFade>Research and Development Platform</span>\n                            <tui-icon\n                                iconStart="@tui.heart"\n                                tuiBadge\n                            />\n                        </div>\n                        <div tuiSubtitle>\n                            Here you can initiate and participate in the review of package objects. Each object have up\n                            to 3 groups of reviewers, with one response required from each type, and any other\n                            participant can change both positive.\n                        </div>\n                        <div\n                            tuiSubtitle\n                            [style.display]="\'flex\'"\n                            [style.gap.rem]="1"\n                        >\n                            <span>\n                                <tui-icon icon="@tui.user" />\n                                Alex Inkin\n                            </span>\n                            Edited 6 minutes ago\n                            <span>\n                                <tui-icon icon="@tui.lock" />\n                                Private\n                            </span>\n                        </div>\n                    </div>\n                    <div tuiAccessories>\n                        <button\n                            tuiButton\n                            type="button"\n                        >\n                            Button\n                        </button>\n                        <button\n                            appearance="primary"\n                            tuiButton\n                            type="button"\n                        >\n                            Button\n                        </button>\n                        <button\n                            iconStart="@tui.ellipsis"\n                            tuiIconButton\n                            type="button"\n                        >\n                            More\n                        </button>\n                    </div>\n                </h2>\n            </ng-container>\n        }\n        @if (current === \'input\') {\n            <ng-container>\n                <h2 tuiHeader>\n                    <div tuiTitle>Projects</div>\n                    <div tuiAccessories>\n                        <button\n                            appearance="primary"\n                            tuiButton\n                            type="button"\n                        >\n                            Create\n                        </button>\n                    </div>\n                </h2>\n                <tui-textfield iconStart="@tui.search">\n                    <input\n                        placeholder="Search"\n                        tuiTextfield\n                    />\n                </tui-textfield>\n            </ng-container>\n        }\n\n        @if (current === \'card\') {\n            <ng-container>\n                <tui-breadcrumbs>\n                    <a\n                        *tuiItem\n                        tuiLink\n                    >\n                        Code\n                    </a>\n                    <a\n                        *tuiItem\n                        tuiLink\n                    >\n                        Repositories\n                    </a>\n                    <span *tuiItem>Taiga UI</span>\n                </tui-breadcrumbs>\n                <div\n                    appearance="floating"\n                    tuiCardLarge="compact"\n                    tuiHeader\n                >\n                    <h2 tuiTitle>\n                        Personal and Development Plan\n                        <span tuiSubtitle>\n                            Here you can initiate and participate in the review of package objects. Each object have up\n                            to 3 groups of reviewers, with one response required from each type, and any other\n                            participant can change both positive\n                        </span>\n                    </h2>\n                </div>\n            </ng-container>\n        }\n\n        <nav tuiTabs>\n            <button\n                tuiTab\n                type="button"\n            >\n                First tab\n            </button>\n            <button\n                tuiTab\n                type="button"\n            >\n                Second tab\n            </button>\n            <button\n                tuiTab\n                type="button"\n            >\n                Third tab\n            </button>\n            <button\n                tuiButton\n                type="button"\n            >\n                Button\n            </button>\n            <button\n                tuiButton\n                type="button"\n            >\n                Button\n            </button>\n        </nav>\n    </header>\n\n    <div\n        *tuiRepeatTimes="let index of 10"\n        appearance="floating"\n        tuiCardLarge="compact"\n        tuiHeader\n        [style.grid-column]="\'span 6\'"\n    >\n        <h2 tuiTitle>\n            Some random content\n            <span tuiSubtitle>A subtitle</span>\n        </h2>\n    </div>\n</main>\n'}}]);